graph_hundertwasser_comment(18,'Hans Neuffer war ein ganz junger Mann, als ich ein eigenartiges Selbstportr&auml;t
von ihm in einer Buchhandlung sah, das mich sehr beeindruckte. Ich fragte, wer
es war und lernte ihn kennen. Seine Bilder waren au&szlig;erhalb jeglicher Norm,
teilweise sogar auf Zeitungspapier (!) gemalt und sicherlich f&uuml;r jeden
Kunstkenner total inakzeptabel. Er war schlaksig, hatte gro&szlig;e H&auml;nde, war aus
b&uuml;rgerlicher Familie und wollte Unb&uuml;rgerliches tun. Durch ihn lernte ich viel
sp&auml;ter Udo Proksch kennen, der noch viel zwielichtiger war. Beide taten
Sachen, die alle Gepflogenheiten sprengten. Ich ging eine Wette mit Udo und
auch Neuffer ein. Wer wohl mehr Einflu&szlig; gewinnt und Macht bekommt, ich mit
meiner Malerei oder sie mit Geld, Politik und Waffen. Udo ist lebenslang in
Haft und Neuffer starb eines seltsamen Todes. Wer hat die Wette gewonnen? Was
Udo Proksch betrifft: Ihm wird zur Last gelegt, zwecks Versicherungsbetrugs
das Schiff &quot;Lucona&quot; im Indischen Ozean versenkt zu haben, wobei sechs Seeleute
ertranken. Dazu mu&szlig; ich wahrheitsgem&auml;&szlig; sagen, da&szlig; in seiner Brust wohl zwei
Seelen stecken m&uuml;ssen. Er hat seine Position als Liebkind der &ouml;sterreichischen
Regierung ausgenutzt, um auch Gutes zu tun, z. B. einen Polizei&uuml;berfall auf
die Aubesetzer (Hainburg, 1984, Anm.) zu verhindern. Auch habe ich ihm zu
verdanken, da&szlig; er mithalf, Treffen zwischen mir, Bundeskanzler Kreisky und
B&uuml;rgermeister Gratz zu beschleunigen, in denen es um den Bau des
&quot;Hundertwasserhauses&quot; ging. So habe ich direkt / indirekt mit vier Schiffen zu
tun: die &Uuml;berfuhr zur Rossauerl&auml;nde, die &quot;SS Bauta&quot;, auf der ich Matrose war,
die &quot;Regentag&quot;, mit der ich nach Neuseeland segelte, und, wenn auch entfernt,
mit der &quot;Lucona&quot;. (siehe auch 529 Spiral with Neuffer Heads)').
graph_hundertwasser_comment(18,'Hans Neuffer was a very young man when I saw a most unusual self-portrait of
his in a bookshop, which impressed me very much. I asked who it was and got to
know him. His pictures were beyond all norms; some of them were even painted
on newspapers (!) and surely unacceptable to any art connoisseur. He was
gangly, with big hands, came from a bourgeois family and wanted to be anything
but bourgeois. Through him I later got to know Udo Proksch, who was a much
shadier character. Both did things which defied all convention. I made a bet
with Udo and Neuffer: who would gain more influence and wield more power, me
with my painting or they with money, politics and weapons. Udo is serving a
life sentence, and Neuffer died a bizarre death. Who won the bet? As to Udo
Proksch, he was convicted of sinking the ship Lucona in the Indian Ocean in an
insurance-fraud scheme, and six seamen drowned. I must truthfully say to all
this that there must be two souls in his breast. He used his position as a
darling of the Austrian government to do good things, too, e.g., to prevent a
police raid on the squatters in the wetlands (Hainburg, 1984, editor&#039;s note).
I also have him to thank for helping to speed up arranging my meetings with
Chancellor Kreisky and Mayor Gratz concerning the construction of the
Hundertwasser House. So I have been connected directly or indirectly with four
boats: the Rossauerl&auml;nde ferry, the S.S. Bauta, on which I was a seaman, the
Regentag, with which I sailed to New Zealand and, albeit from a distance, the
Lucona (see also 529 [??: dieses Lemma ist 529!] Spiral with Neuffer Heads)').
graph_hundertwasser_comment(24,'Mich hat die typisch franz&ouml;sische Art und Weise des Graphik-Edition-Betruges
sehr aufgebracht. Ich wollte mit gutem Beispiel vorangehen, es ehrlich machen
und ein Exempel setzen. Es war (und ist) gang und g&auml;be, da&szlig; man eine
Graphik-Edition mehrmals aufteilt und einzeln numeriert, um so eine kleine
Auflage vorzut&auml;uschen. Diese aufgeteilten, jedesmal von vorne neu numerierten
Teilserien, mit dem Anspruch einer alleinigen Edition des betreffenden Blattes
hatten Phantasienamen wie: grand marge (dasselbe auf gr&ouml;&szlig;erem Papier
gedruckt), pour l&#039;artiste (wieder dasselbe), epreuve d&#039;artiste (wieder
dasselbe und keine echten Proben), h.c. - hors commerce (was dennoch in den
Handel kam) auf verschiedenen, auch anders farbigen Papieren, &quot;auf Japan&quot;,
&quot;auf B&uuml;tten&quot;, signiert, drucksigniert, als Plakatdruck (dasselbe nochmals auf
schlechtem Papier gedruckt), dazu noch die Normalauflage (m&ouml;glichst klein).
Wenn man alle diese Spezialdrucke derselben Graphik zusammenz&auml;hlt, kommt man
auf ein Vielfaches der angegebenen Editionsh&ouml;he. Ich habe das getan, was mir
den Zorn der franz&ouml;sischen Graphikh&auml;ndlerwelt einbrachte: Ich habe ganz
einfach alles durchnumeriert und auf jedem Blatt die tats&auml;chliche Auflagenh&ouml;he
angegeben.').
graph_hundertwasser_comment(24,'The typical French method of graphic-edition fraud infuriated me. I wanted to
set a good example and do it honestly. It was (and is) common practise to
divide a graphic up into several series and number them separately to make it
look like it is a small edition. These partial series, each numbered
separately from the beginning, claiming to be an exclusive edition of the
graphic in question, had imaginative names such as: grand marge (the same
graphic printed on larger-format paper), pour l&#039;artiste (same graphic again),
&eacute;preuve d&#039;artiste (same graphic again, not really proofs), h. c. - hors
commerce (they were put on the market anyway), on different and
different-coloured paper, &quot;Japanese&quot;, &quot;vat - handmade - paper&quot;, signed,
print-signed, as poster print (same graphic printed on poor-quality paper), in
addition to the normal print run (the smaller the better). If you count up all
these special print runs of the same graphic, the indicated quantity of the
edition is multiplied many times over. I did that, which made the world of
French graphics dealers very angry with me: I just numbered everything all the
way through and indicated the real quantity of the edition on each print.').
graph_hundertwasser_comment(34,'Dies war der Beginn einer langen Zusammenarbeit mit meinem Freund, dem
&quot;Coordinatore&quot; Alberto Della Vecchia. Bis jetzt hatte ich mich dagegen
gewehrt, Graphiken zu machen. Was bisher entstand, war quasi gezwungenerma&szlig;en
entstanden. Bis Alberto mir eine von ihm gestaltete &quot;Hundertwassergraphik&quot;
brachte. Mir wurde gleich &uuml;bel: ein mich nach&auml;ffender Kitsch. Trotzdem war es
der entscheidende Ansto&szlig;, es besser und richtig zu machen. So entstand &quot;King
Kong&quot;.').
graph_hundertwasser_comment(34,'This was the beginning of a long period of working together with my friend,
the &quot;Coordinatore&quot; Alberto Della Vecchia. Up to that time I had resisted doing
graphics. What had been done in this line hitherto had come about more or less
because I had no choice. Until Alberto brought me a &quot;Hundertwasser graphic&quot; he
had done. I immediately felt ill: this was kitsch which aped my style.
Nonetheless, it was the decisive impetus to do it better, to do it right. Thus
&quot;King Kong&quot; came to be.').
graph_hundertwasser_comment(36,'Eine Hommage an Walter Kampmann, der mir die Seelenb&auml;ume geschenkt hat. Er
starb, als die Rote Armee einmarschierte, 1945 &ouml;stlich von Berlin. Es w&auml;re
sch&ouml;n, ihm im Regen unter seinen Seelenb&auml;umen zu begegnen.').
graph_hundertwasser_comment(36,'An homage to Walter Kampmann, who gave me the soul-trees. He died when the Red
Army marched in, in 1945, east of Berlin. It would be wonderful to meet him in
the rain among his soul-trees.').
graph_hundertwasser_comment(41,'Ich war immer sehr gl&uuml;cklich, wenn ich verschiedene Ausdrucksformen, die ich
geschaffen hatte, miteinander verbinden konnte. Dies ist das Schiff Regentag
und die Spirale als Wasserstrudel. Es ist sch&ouml;n, sich auf eigene Sch&ouml;pfungen
st&uuml;tzen zu k&ouml;nnen. Es ist das eigene Land, auf dem man steht und in dem man
herumgehen kann.').
graph_hundertwasser_comment(41,'I was always very happy when I was able to combine different forms of
expression I had created. This is the boat Regentag and the spiral as a
maelstrom. It is nice when you can fall back on your own creations. It is your
own territory that you stand on and can walk around in.').
graph_hundertwasser_comment(42,'Dies ist meine erste durchnumerierte Gro&szlig;auflage, die eigentlich gar keine
ist, da sie aus vielen Variationen besteht. Der Ursprung ist 151 Bleeding
Houses. Ich habe Monate in der Druckerei in Campalto verbracht, w&auml;hrend ich
auf der &quot;Regentag&quot; nicht weit davon in einem Kanal der Lagune bei Ca&#039;Noghera
lag. Es war wie ein Simultan-Schachspiel mit &uuml;ber vierzig Gegnern. Ich tat
dies noch konsequenter mit dem sp&auml;teren Siebruck 860 Homo Humus come va. Ich
glaube nicht, da&szlig; mir jemand dieses gigantische Unternehmen gleichtun kann,
das mich zwei Jahre beanspruchte. Ich verwendete v&ouml;llig neue Techniken in der
Druckgraphik: Metallpr&auml;gedruck, Phosphorfarben, die in der Nacht leuchten,
reflektierende Glasperlen-Aufdrucke, konvexe Pr&auml;gungen und eine unglaubliche
Anzahl von Farb&uuml;berdrucken, die ich einzeln auf Transparentfolien malte und
die dann auf Sieb &uuml;bertragen wurden. Dann die Probedrucke der unendlich
gewordenen Farbkombinationen. Ich wollte das Flie&szlig;band ad absurdum f&uuml;hren. In
die Enge getrieben, zwischen einer unglaublich einsetzenden Nachfrage und
meinem Stolz, Originale und nicht Massenware zu schaffen, und bestrebt, soviel
von meinem inneren Selbst wie nur m&ouml;glich zu geben. Es kam zu einem Proze&szlig;,
den ich auch gewann, weil ich die Preise (wie bei der Art-Club-Mappe 1951)
niedrig halten wollte - 100 Mark pro Blatt, damit es vielen zug&auml;nglich ist. Es
war verlorene M&uuml;he. Den freien Marktwert konnte ich nicht bestimmen. Es war
Sieg und Niederlage zugleich.').
graph_hundertwasser_comment(42,'This is my first large print edition, which I numbered from beginning to end;
but actually it isn&#039;t one, since it consists of many variations. It is based
on 151 Bleeding Houses. I spent months in the print shop in Campalto, while
the Regentag lay in berth not far away, in a canal of the lagoon near Ca&#039;
Noghera. It was like a simultaneous chess match with more than forty
opponents. I did this even more radically later with the silkscreen print 860
Homo Humus come va. I don&#039;t think anyone can outdo me in this gigantic
enterprise, which took up two years of my life. I used completely new
Technique keywords in print graphics: metallic-stamp printing, phosphorescent colours
that glow in the dark, reflecting glass-bead appliqu&eacute;s, convex embossing and
an incredible number of colour overprints which I painted separately on
transparent foil, from where they were transferred to the screen. Then the
proofs of the infinite number of colour combinations. I wanted to reduce the
conveyor belt to absurdity. I got myself into a bind between the incredible
demand which had materialised and my pride in creating something original, not
mass-produced, and I wanted to give as much of my inner self as I could. I
went to court and won because I wanted to keep the prices low (just like with
the Art Club portfolio of 1951) - 100 marks per print, to make it accessible
to many people. It was all for nought. I could not fix the price on the open
market. It was a victory and a defeat all in one.').
