market. It was a victory and a defeat all in one.').
graph_hundertwasser_comment(55,'Eine eigenartige Premonition [Vorwarnung]: Die Blutstropfen auf dem Poster
malte ich vor dem Massaker w&auml;hrend der Olympischen Spiele. Als Vorlage diente
mein Bild 147 Das Match des Jahrhunderts. Mitten hinein malte ich die
orthodoxe Kirche, die &quot;V&auml;terchen Timofej&quot;, ein eigenwilliger, selbsternannter
russischer Pope, gegen alle Baubewilligungen gerade dort baute, wo die
Olympischen Spiele stattfinden w&uuml;rden. Die Liebe der M&uuml;nchner verhinderte
jedoch den Abri&szlig; der Kirche Timofejs. Ich habe ihn &ouml;fters besucht und seine
Zwiebelt&uuml;rme, die mit glitzerndem Stanniolschokoladepapier beschichtet waren.
Ich f&uuml;hlte meinen Hang zu Gold und Silber und Metallpr&auml;gungen best&auml;tigt.  Es
war ein heiliges Gef&uuml;hl.').
graph_hundertwasser_comment(55,'An odd premonition: the drops of blood on the poster I painted before the
massacre during the Olympic Games. It is based on my picture 147 The Match of
the Century. In the middle of it I painted in the orthodox church which
&quot;Father Timofey&quot;, a self-willed, self-proclaimed Russian-orthodox priest, had
built in defiance of any building permit right in the middle of where the
Olympic Games were to take place. However, the love of the people of Munich
prevented the church from being torn down. Several times I visited him and his
onion turrets, whose outside covering consisted of shiny tinfoil from
chocolate wrappings. I felt my predilection for gold and silver and
metal-stamping confirmed. It was a holy feeling.').
graph_hundertwasser_comment(57,'Eines der wenigen Bilder, die ich mit anderen Malern zusammen malte wie mit
Br&ocirc; bzw. wo andere meinen Bildern nur etwas hinzuf&uuml;gten wie Neuffer oder Kito.
Bei diesem Siebdruck habe ich nur die Umrandung und die untere Leiste
gestaltet und die &Auml;pfel in Metallpr&auml;gung gedruckt. Sonnenstern schuf einen
Adam, einen Mann mit Kopf, jedoch verdorrt und &ouml;de, und diese Frau, Eva, zwar
ohne Kopf, jedoch voll mit Fr&uuml;chten und Bl&uuml;ten.').
graph_hundertwasser_comment(57,'One of the few pictures I painted together with other painters, such as with
Br&ocirc;, or where others just added something to my pictures, such as Neuffer or
Kito. In this silkscreen print I only did the margin and the bottom portion
and printed the apples in metallic-stamping. Sonnenstern did an Adam, a man
with a head, but withered and barren, and this woman, Eve, who may have no
head, but is full of fruits and blossoms.').
graph_hundertwasser_comment(66,'Meine Aufteilung der Druckgraphik-Herstellung war voll im Gange: Japan war
zust&auml;ndig f&uuml;r Holzschnitte, Paris f&uuml;r Lithographien, Venedig f&uuml;r
Seidensiebdrucke und Wien f&uuml;r Radierungen und Kupferstiche. Ich glaube, es
gibt keine bessere Einteilung und Benutzung der traditionellen Meisterschaft
in den einzelnen Sparten der Druckgraphik.').
graph_hundertwasser_comment(66,'My division of labour for print-graphics production was in full force: Japan
for wood-block prints, Paris for lithography, Venice for silkscreen printing
and Vienna for engraving and copperplate engraving. I think there is no better
way of dividing up and utilising the traditional mastery in the various
sectors of print graphics.').
graph_hundertwasser_comment(69,'Der Tod der tausend Fenster (1964) Der gr&uuml;ne Regen f&auml;llt. Der gr&uuml;ne Regen
f&auml;llt nur auf lila D&auml;cher. Der gr&uuml;ne Regen rinnt nur &uuml;ber schwarze Mauern. Der
gr&uuml;ne Regen rinnt in tausend verl&ouml;schende Fenster. Der gr&uuml;ne Regen f&uuml;llt
tausend Wohnungen mit Smaragd.  Die Sonne ist nur sch&ouml;n, wenn sie sinkt. Die
Sonne ist am sch&ouml;nsten, wenn es regnet. Fenster sind am sch&ouml;nsten, wenn es
regnet. Fenster sind am sch&ouml;nsten, wenn sie Fieber haben und sterben. Wasser
ist am sch&ouml;nsten, wenn lebendes Fensterglas tief im Wasser versinkt.  Die
Pr&auml;rie bedeckt den Regen mit ihrer gr&uuml;nen Haut. Die Pr&auml;rie kennt alle tausend
Fenster. Stolpere nicht &uuml;ber die Wellen. Gehe vorsichtig &uuml;ber die Pr&auml;rie,
damit das Gr&uuml;n nicht zerbricht.  (verfa&szlig;t 1964, aus: W. Schurian (Hrsg.),
Hundertwasser - Sch&ouml;ne Wege, gedanken &uuml;ber kunst und Leben, M&uuml;nchen 1983, S.
154)').
graph_hundertwasser_comment(69,'The Death of Thousand Windows (1973)  Green Rain Falls Green Rain Falls Only
on Violet Roofs Green Rain Runs Only over Black Walls Green Rain Runs into
Thousand Dying Windows Green Rain Fills Thousand Flats with Emerald  The Sun
Is Only Beautiful when she Falls The Sun Is Most Beautiful when it Rains
Windows Are Most Beautiful when They Have A Fever and Die Water Is Most
Beautiful when the Town Drowns in it Green Is Most Beautiful when Living
Window Panes Sink into Deep Water  The Prairie Covers the Rain with its Green
Skin The Prairie Knows all Thousand Windows Do Not Stumble over the Waves Walk
over the Prairie with Care so that the Green Does Not Break (from: Cat.
Aberbach Fine Art, New York, 1973)').
graph_hundertwasser_comment(80,'Als Karl-May-Winnetou-Leser, in jungen Jahren, hat mich die Indianertrag&ouml;die
sehr bewegt, und Gedanken und Bilder zu diesem Thema kommen seltsam ver&auml;ndert,
spontan daher, so &auml;hnlich wie auch meine Dalai-Lama-Tibet-Bilder. Es sind
keine direkten Kampf- und Anklagebilder, sondern im Unterbewu&szlig;tsein
transformierte Traumbilder. Wie das im Wachzustand entsteht, kann ich nicht
erkl&auml;ren. (siehe auch 586)').
graph_hundertwasser_comment(80,'As a reader of Karl May&#039;s &quot;Winnetou&quot; as a lad, I was very moved by the tragedy
of the Indians, and thoughts and images on this subject come to me
spontaneously, in strange mutations, in a way similar to my Dalai Lama
pictures. They are not directly confrontational and accusing pictures, but
dream pictures transformed in the subconscious. How that happens in waking
moments I cannot explain. (see also 586)').
graph_hundertwasser_comment(84,'Diese Signaturtage sind nicht als Arbeitstage auf der R&uuml;ckseite angegeben. Um
Entspannungspausen f&uuml;r die Finger und den Geist einzulegen, hat Hundertwasser,
bei bedeutenden Signaturetappennummern angelangt, das Signieren unterbrochen
und ist mit Alberto einen Kaffee trinken gegangen, ins Arkadencaf&eacute; Bella
Venezia, oder eine Sektflasche wurde zu diesem Anla&szlig; bereitgehalten, aber
nicht getrunken. Hundertwasser hat den Datumstempel gesetzt und in
selbstgemachter Tusche signiert, in Tusche, die er aus fl&uuml;ssigem Ru&szlig; gewonnen
hat, das aus seinem Ofenrohr tropft. Er hat die GumTechnique keywordempel 10002 &uuml;ber die
Zahlen 10001 gesetzt und die japanischen Stempel mit dem japanischen
Stempelkissen (Inkan) angebracht. Es wurden jeweils 10 Bl&auml;tter abgez&auml;hlt und
jeweils 50 Exemplare in Reihen von f&uuml;nf mal zehn St&uuml;ck auf einem langen Tisch
in einem separaten Zimmer aufgelegt, um die Signatur und Stempelarbeit zu
erleichtern. Je zehn St&uuml;ck &uuml;bereinandergef&auml;cherte Graphiken wurden dann zum
Trocknen der Ru&szlig;tintensignatur und der japanischen Stempel in die
Siebdruckerei zur&uuml;ckgetragen und auf Trockenf&auml;cher gelegt. Alberto half dabei.
(aus: Brosch&uuml;re zu 860 Homo Humus come va, Die Galerie, Offenbach am Main,
1984) Das war eine Anstrengung, die schwer nachvollziehbar ist: zehntausend
Originale innerhalb einer Edition. Das Signieren allein dauerte achtzehn Tage,
innerhalb von zwei Monaten.').
graph_hundertwasser_comment(84,'These signing days are not included in the days of work indicated on the
reverse side. To give his fingers and spirit a break, Hundertwasser
interrupted the signing once he reached a significant stage in the numbering
and went with Alberto to have a cup of coffee in the arcade caf&eacute; Bella
Venezia. A bottle of sparkling wine was kept on ice for this occasion, too,
but remained unopened. Hundertwasser applied the date stamp and signed with
home-made india ink, which he obtained using liquid soot which dripped from
his stovepipe. He used a rubber stamp to correct the printed number 10001 to
10002 and a Japanese stamp with an inkan, the Japanese ink pad. The sheets
were stacked in tens, and 50 formed a row of 5 stacks of 10 on a long table in
a separate room, to facilitate the signing and stamping. Sets of ten sheets
were then fanned out and carried back to the printshop to dry the soot-ink
signature and the Japanese stamp by laying them on drying shelves. Alberto
lent a hand in this. (from: brochure on 860 Homo Humus come va, Die Galerie,
Offenbach on the Main, 1984)  This was a strenuous effort which can hardly be
imagined: ten thousand originals in one edition. Just signing them all took
eighteen days in the course of two months.').
graph_hundertwasser_comment(85,'Bienen sehen viele Bilder gleichzeitig. Die Stadt mit ihren vielen Fenstern
spiegelt sich im Stadtmenschengesicht - das bin anscheinend ich. Wenn Picasso
Gesichter aufklappen kann, so kann man auch auf dem Gesicht darstellen, was
das Gesicht sieht. Das, was man sieht, und die Umwelt vereinigen sich sowieso
mit der Seele dessen, der davon umgeben ist. Daher wird man h&auml;&szlig;lich und krank,
wenn man optischer Umweltverschmutzung ausgesetzt ist. Das lernt man in
Architekturschulen nicht, die in der falschen Rationalit&auml;t gefangen sind.').
graph_hundertwasser_comment(85,'Bees see many images at the same time. The city, with its many windows, is
reflected in the face of the city-man - that is me, apparently. If Picasso can
unfold faces, one can also show on the face what the face sees. What one sees
and one&#039;s surroundings unite with the soul of the person they surround, as it
is. That is why one grows ugly and sick when one is exposed to visual
pollution. People don&#039;t learn that at the architecture schools, which are
caught up in false rationality.').
graph_hundertwasser_comment(107,'Ganz links steht vielleicht Kokoschka. Es ist mir gelungen, etwas sehr
japanisch Samuraihaftes ins Bild zu bringen.').
graph_hundertwasser_comment(107,'That might be Kokoschka on the far right. I succeeded in bringing something
very Japanese and samurai-like into the picture.').
graph_hundertwasser_comment_en(1,'Alfred Schmeller (Vizepr&auml;sident des Art Club, 1951/52, Anm.) wollte billige,
f&uuml;r jeden erschwingliche Graphik-Mappen herausbringen. Die Maler Josef Mikl
und Johann Fruhmann, ich glaube auch Kurt Moldovan, sagten ebenfalls zu. Das
Druckverfahren Zinklithographie auf einer Walze war neu in Wien. Der Preis
betrug zehn Schilling pro Mappe mit je zehn Bl&auml;ttern, also ein Schilling pro
Blatt. Jahrelang wollte niemand meine Mappe kaufen, nur Fritz Wotruba kam
einmal in den Strohkoffer, spendete zwanzig Schilling, wollte die Mappe aber
nicht mitnehmen.').
graph_hundertwasser_comment_ge(1,'Alfred Schmeller (Vice-President of the Art-Club, 1951/52 - editor&#039;s note)
wanted to produce cheap graphic portfolios that anybody could afford. The
painter Josef Mikl and Johann Fruhmann and I think Kurt Moldovan, too, also
agreed to it. The one-cylinder zink-lithography printing process was new in
Vienna. The price was ten schillings for a portfolio of ten pictures, i. e.,
one schilling apiece. For years nobody wanted to buy my portfolio. Fritz
Wotruba was the only one who came to the &quot;Straw Valise&quot;, donated twenty
schillings, but didn&#039;t want to take the portfolio with him.').
