graph_information(1,'Proofs as well as a number of excess and deficient specimens were produced
during the printing of the portfolio. This makes it impossible to provide a
reliable record of each portfolio edition today. Very few complete portfolios
exist.').
graph_information(15,'Carl L&aacute;szl&oacute;, Kunsth&auml;ndler in Basel, lie&szlig; eine Dalai-Lama-Ausgabe der
Zeitschrift  Panderma enstehen, der eine Originallithographie Hundertwassers
zum Thema der Flucht des Dalai-Lama beigelegt werden sollte. Der K&uuml;nstler
konzipierte das Blatt so, da&szlig; es quer in der Mitte durchgeschnitten, der
untere Teil links an den oberen zu einem L&auml;ngsformat geklebt und gefaltet,
eingef&uuml;gt werden konnte. (28 x 118 cm)').
graph_information(15,'Carl L&aacute;szl&oacute;, art dealer at Basel, arranged for the periodical Panderma to
publish an issue on the Dalai Lama to be accompanied by an original
Hundertwasser lithograph on the subject of his escape. The artist designed the
sheet so that, cut horizontally along the centre, the lower part stuck to the
left of upper part to achieve a longitudinal format, it could be folded to fit
in as a supplement (28 x 118 cm).').
graph_information(23,'Zus&auml;tzliche  66 St&uuml;ck (33 von jeder Farbvariante) wurden, unsigniert und nicht
nummeriert, in St&uuml;cke geschnitten und auf die Vorderseiten des Schachtelbuches
638 A Hauteurs de Machu Picch&uacute; geklebt, siehe APA 85.').
graph_information(23,'An additional 66 (33 of each colour variant), unsigned and not numbered, were
cut into pieces and glued onto the fronts of the nest of boxes 638 A Hauteurs
de Machu Picch&uacute;, see APA 85').
graph_information(24,'After the painting Nr. 344 Nostalgie de l&#039;au dela: taken off the outer spirals
replaced with windows; goint farther than the margin. Taken off 2 central part
replaced with spirals and smoke. Taken off lower part and right edge,
replacing it with 2 faces, one ship, and a fence. On the pl. wrongly numbered
633.').
graph_information(26,'After the painting no. 635 Ma jiz nektere snalosti cestiny, Adding personally
green hair on the bald head and a beard; changed the white tower on the right
side of the head from white to black. Omitted the spider net under the head; a
face in one window. I worked on the windows, making more of them black; added
several inscriptions: Marta, and som black drops.').
graph_information(71,'Das Buch umfa&szlig;t 114 Seiten, alle Farbholzschnitte bis 1975 in
Farbreproduktionen mit Textbeitr&auml;gen verschiedener Autoren und einer Liste von
Meisterhandwerkern, die mit der Herstellung befa&szlig;t waren.').
graph_information(71,'The book comprises 114 pages, the complete woodcut oeuvre up to 1975 in colour
reproductions, text contributions by various authors, and a list of the master
artisans engaged in the production.').
graph_information(99,'Herausgegeben zur finanziellen Unterst&uuml;tzung der Umgestaltung der St. Barbara
Kirche in B&auml;rnbach. Pr&auml;sentiert in der Galerie Hilger in Wien, am 4. Dezember
1987.').
graph_information(99,'Donated for funds for the construction of the Church of St. Barbara in
B&auml;rnbach. Presented at Galerie Hilger, Vienna, December 4, 1987.').
